// Initialize output variables
let images = [];

for (const item of $input.all()) {
  const block = item.json;

  if (block.type === 'image') {
    const imageUrl = block.image?.file?.url;
    if (imageUrl) {
      images.push(imageUrl);
    }
  }
}

return [
  {
    json: {
      images,
    },
  },
];

